<pre><span class="s0">pip is a command line program. While it is implemented in Python, and so is</span>
<span class="s0">available for import, you must not use pip's internal APIs in this way. Typing</span>
<span class="s0">information is provided as a convenience only and is not a guarantee. Expect</span>
<span class="s0">unannounced changes to the API and types in releases.</span>
</pre>
